import React, { useState } from 'react';

function FilterPanel() {
  const [filters, setFilters] = useState({
    assetType: '',
    timeRange: '',
    region: ''
  });

  const handleChange = (e) => {
    setFilters({ ...filters, [e.target.name]: e.target.value });
  };

  return (
    <div>
      <h2>Filters</h2>
      <label>
        Asset Type:
        <select name="assetType" value={filters.assetType} onChange={handleChange}>
          <option value="">All</option>
          <option value="VESSEL">Vessel</option>
          <option value="AIRCRAFT">Aircraft</option>
          <option value="VEHICLE">Vehicle</option>
        </select>
      </label>
      <label>
        Time Range:
        <input type="datetime-local" name="timeRange" value={filters.timeRange} onChange={handleChange} />
      </label>
      <label>
        Region:
        <input type="text" name="region" placeholder="Region ID" value={filters.region} onChange={handleChange} />
      </label>
    </div>
  );
}

export default FilterPanel;
